create table tb_book (id bigint generated by default as identity, author varchar(255), genre varchar(255), isbn bigint, language varchar(255), photo varchar(255), price double, title varchar(255), primary key (id));
create table tb_role (id bigint generated by default as identity, name varchar(255), primary key (id));
create table tb_user (id bigint generated by default as identity, email varchar(255), mobile varchar(255), name varchar(255), password varchar(255), role_id bigint, primary key (id));
alter table tb_user add constraint FKrfmat6i7yc88kv6aqusrqiv6e foreign key (role_id) references tb_role;
